class Requests {
    async getCurrencyRate () {
        try{
            const response = await fetch('https://api.privatbank.ua/p24api/pubinfo?exchange&json&coursid=5');
            return await response.json();
        } catch(error){
            throw error;
        }
    }
}

export default Requests;
